import React from 'react'

export const Overlay = ({
	title = 'Your moo',
	subtitle = '',
	backgroundColor = '#000'
}) => {
	const truncateAt = 50
	if (title.length > truncateAt) {
		title = title.substr(0, truncateAt)
		title += '...'
	}

	return (
		<svg
			width="1200"
			height="600"
			viewBox="0 0 400 200"
			style={{
				fontFamily: 'helvetica'
			}}
		>
			<defs>
				<clipPath id="clip">
					<use xlinkHref="#rect" />
				</clipPath>
				<filter id="shadow">
					<feDropShadow
						dx="0.2"
						dy="1.2"
						stdDeviation="0.2"
						floodOpacity="0.2"
					/>
				</filter>
			</defs>

			<g filterUrl="#shadow">
				<rect
					width="400"
					height="60"
					x="0"
					y="140"
					opacity="0.6"
					style={{ fill: backgroundColor }}
				/>
			</g>
			<g filterUrl="#shadow">
				<g stroke="2" clipPath="url(#clip)">
					<rect
						id="rect"
						width="32"
						height="32"
						x="355"
						y="156"
						fill="none"
						stroke="#2b6cb0"
						strokeWidth="1"
						rx="50"
					/>
					<image width="32" height="32" x="355" y="156" xlinkHref={image64} />
				</g>
			</g>
			<g style={{ fill: '#fff', fontSize: 14 }}>
				<text x="10" y="170">
					{title}
				</text>
				<text x="10" y="185" style={{ fontSize: 11, fill: '#d3d3d3' }}>
					{subtitle}
				</text>
			</g>
		</svg>
	)
}

const image64 =
	'data:image/jpeg;base64,'
